import React from 'react';

function StateTable() {
    return (

        <div className="container" style={{
                margin: "auto",
                width: "75%",
                paddingTop: "60px"
              }}>
            <div className="row">
                <div className="col-6" style={{
                     border: "1px solid gray"
                }}>Processes' State</div>
                <div className="col-6" style={{
                     border: "1px solid gray"
                }}>Queue's State</div>
                <div className="col-3">.col-4</div>
                <div className="col-3">.col-6</div>
                <div className="col-2">.col-3</div>
                <div className="col-2">.col-3</div>
                <div className="col-2">.col-3</div>
            </div>
        </div>

    )
}

export default StateTable;
